import React, { Component } from 'react'
import aos from 'aos'
import '../all.css'
import '../style.css'
import 'aos/dist/aos.css';
import SiteTitle from './Sitetitle'
import TopProject from './TopProject'
export default class Home extends Component {
  render() {
    return (
      <div>
          <SiteTitle />
          <TopProject />
      </div>
    )
  }
}
